import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Home from './home';
import API from './API';

const pages = () => {
    return(
        <Router>
            <Route exact path="/" component= {Home} />
            <Route path = "/user" component = {API} />
        </Router>
    );
};export default Pages;
